import React, { Component } from "react";
import { Link } from "react-router-dom";

import HeaderLogin from "../components/HeaderLogin";

export default class Cadastro extends Component {

  render() {
    return (
      <body class="login tipo-cadastro cadastrar bg-login responsive">
        <div className="container">
        <HeaderLogin page="cadastro" />
          <main>

          <div className="txt-login">
              <h1 className="titulo">Falta pouco para você <br /> fazer parte do <span className="titulo-bold">melhor <br /> site de presentes do <br /> Brasil!</span></h1>

              <div className="icon rounded yellow shadow-20">
                  <i className="ng-user-alt"></i>
              </div>

              <p className="p-1">Já tem uma conta?</p>
              <p className="txt-facebook"><Link to="login.html" className="faca-login">Faça login</Link> ou entre <br /> com o <Link to="#" class="cyan">Facebook.</Link></p>
          </div>

          </main>



          <footer>
              <div className="flex flex-column ">
                  <div className="flex flex-space">
                      <div className="menu-footer"><Link to="">Home</Link><span>|</span><Link to="#">Buscar uma festa</Link><span>|</span><Link to="/duvidas">Dúvidas</Link><span>|</span><Link to="/contato">Contato</Link></div>
                      <div className="copyright">® 2019 NETGIFT - CPNJ 99.304.401/0001-00 - <Link to="/termos">TERMOS DE SERVIÇO</Link>.</div>

                      <p className="copyright copyright-mobile">® 2019 NETGIFT - CPNJ 99.304.401/0001-00</p>
                  </div>
              </div>
          </footer>

        </div>
      </body>
    );
  }
}
